import React from 'react'
import { Document, Page, pdfjs } from "react-pdf"
import PDF from "../assets/CV.pdf"



const CVPDF = () => {
    pdfjs.GlobalWorkerOptions.workerSrc = new URL(
        'npm:pdfjs-dist/build/pdf.worker.min.js',
           import.meta.url,
         ).toString();

  return (
    <div>
      <Document file={PDF} >
        <Page pageNumber={1} />
      </Document>
    </div>
  )
}

export default CVPDF
